import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./parks.json";
import "./ParkComponent.css";

class ParkComponent extends Component {
  render() {
    let AllParks = Parks.map(park => {
      return (
        <div className="parkcomponent-container">
          <Link to={`park/${park.parkCode}`}>
            <p className="ParkName">{park.name}</p>
            <div className="ImageContainer">
              <div className="fade" />
              <img className="Image" src={park.images[0].url} />
            </div>
          </Link>
        </div>
      );
    });
    return <div className="grid">{AllParks}</div>;
  }
}

export default ParkComponent;
